import React from 'react';

function Game_Grid(){
    const arr=[];

    const renderBox =() => {
        
        for(let i=0; i< 50; i++){
            arr[i]=i;
        }
    }
    return (
        <div>
            <div className="ui_grid">
            {arr.map(box => <div className="box" key ={box}>{box}</div>)}
        </div>
        </div>
        
    );
}


export default Game_Grid;
